import React, { Component } from 'react'
import Home from './components/pages/home'
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import ResumeBuilder from './components/cv builder/resume-sample';
import Cover from './components/cover letter/cover';
import JobSearch from './components/job-pathway/job';
import Interviews from './components/interviews/interviews'
import Navbar from './components/pages/Navbar';
import Footer from './components/pages/footer'


class App extends Component {
  constructor(props) {
    super(props);
    this.state = {}
    this.connecToServer = this.connecToServer.bind(this);
  }
  connecToServer() { fetch('/'); }
  componentDidMount() { this.connecToServer(); }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <BrowserRouter>
            <Navbar />
            <Switch>
              <Route exact path="/" component={Home} />
              <Route path="/resume-sample" component={ResumeBuilder} />
              <Route path="/coverletter" component={Cover} />
              <Route path="/job-search" component={JobSearch} />
              <Route path="/interviews" component={Interviews} />
            </Switch>
            {/* <Footer /> */}
          </BrowserRouter>
        </header>
      </div>
    )
  }
}

export default App
